import React from "react";

import data from './data.json';


const MainTable =()=>{

    const dataImport = data[0]; 

    function renderHeaders(){
        let Headers = [];

        console.log(dataImport);

        return Headers; 

    }

    return(
    <React.Fragment>

        <p>Table</p>
        <table class="table">
            <thead>
                <tr>{renderHeaders()}</tr>
            </thead>
        </table>
    </React.Fragment> 
    )
}

export default MainTable;
